import './App.css';
import React from "react";
import NavBar from './components/NavBar/NavBar';
import Home from "./components/Home"
import ProductPage from "./components/ProductPage"
import ProductList from './components/ProductList';

function App() {
  return (
    <div className="App">
      <NavBar />
      <Home />
      <ProductList />
    </div>
  );
}

export default App;
